#all the codes and functions related to creating the prompt
import base64
import vertexai
from vertexai.generative_models import GenerativeModel, Part, FinishReason
import vertexai.preview.generative_models as generative_models

def generate():
    vertexai.init(project="virtual-core-418819", location="us-central1")
    model = GenerativeModel("gemini-1.0-pro-vision-001")
    responses = model.generate_content(
      [text1, image1],
      generation_config=generation_config,
      safety_settings=safety_settings,
      stream=True,
  )
    #concat the strings
    concat = ""
    for response in responses:
        concat += response.text
    #print(response.text, end="")
    return concat

text1 = """generate 2 multiple questions in json format following this schema [{\"question: String, \"options\": String[], \"answer\": String}]"""
image1 = Part.from_data(
    mime_type="image/png",
    data=base64.b64decode(""""""))

generation_config = {
    "max_output_tokens": 2048,
    "temperature": 0.4,
    "top_p": 0.4,
    "top_k": 32,
}

safety_settings = {
    generative_models.HarmCategory.HARM_CATEGORY_HATE_SPEECH: generative_models.HarmBlockThreshold.BLOCK_MEDIUM_AND_ABOVE,
    generative_models.HarmCategory.HARM_CATEGORY_DANGEROUS_CONTENT: generative_models.HarmBlockThreshold.BLOCK_MEDIUM_AND_ABOVE,
    generative_models.HarmCategory.HARM_CATEGORY_SEXUALLY_EXPLICIT: generative_models.HarmBlockThreshold.BLOCK_MEDIUM_AND_ABOVE,
    generative_models.HarmCategory.HARM_CATEGORY_HARASSMENT: generative_models.HarmBlockThreshold.BLOCK_MEDIUM_AND_ABOVE,
}

generate()

